import React from 'react';
import './Pricing.css';

function Pricing() {
  return (
    <div className="pricing">
      <h1>Our Pricing</h1>
      <div className="price-card">
        <h2>Basic Plan</h2>
        <p>$499 - Ideal for small businesses.</p>
      </div>
      <div className="price-card">
        <h2>Premium Plan</h2>
        <p>$999 - Advanced features for growth.</p>
      </div>
    </div>
  );
}

export default Pricing;
